void initialize_ncurses()
{
  signal(SIGINT, finish);
  initscr();
  keypad(stdscr, TRUE);
  nonl();
  intrflush(stdscr, FALSE);
  noecho();
  cbreak();
  if (has_colors())
  {
    start_color();
    init_pair(COLOR_BLACK, COLOR_BLACK, COLOR_BLACK);
    init_pair(COLOR_GREEN, COLOR_GREEN, COLOR_BLACK);
    init_pair(COLOR_RED, COLOR_RED, COLOR_BLACK);
    init_pair(COLOR_CYAN, COLOR_CYAN, COLOR_BLACK);
    init_pair(COLOR_WHITE, COLOR_WHITE, COLOR_BLACK);
    init_pair(COLOR_MAGENTA, COLOR_MAGENTA, COLOR_BLACK);
    init_pair(COLOR_BLUE, COLOR_BLUE, COLOR_BLACK);
    init_pair(COLOR_YELLOW, COLOR_YELLOW, COLOR_BLACK);
  }
}

void initialize_arrays()
{
  int counter;
  int counter2;
  screen_object empty;
  int i = 0;
  screen = malloc((sizeof(int *)) * ((COLS - 1) + 1));
  for (i = 0; i < ((COLS - 1) + 1); i += 1)
  {
    screen[i] = malloc((sizeof(int)) * ((LINES - 1) + 1));
  }

  empty.x = -1;
  empty.y = -1;
  empty.color = 0;
  empty.bold = FALSE;
  empty.character = ' ';
  for (counter = 0; counter <= (COLS - 1); counter += 1)
  {
    for (counter2 = 0; counter2 <= (LINES - 1); counter2 += 1)
    {
      screen[counter][counter2] = -1;
    }

  }

  for (counter = 0; counter < ((sizeof(messages)) / (sizeof(char *))); counter += 1)
  {
    used_messages[counter] = 0;
    bogus_messages[counter] = 0;
    bogus[counter] = empty;
  }

}

void initialize_robot()
{
  robot.x = (rand() % (COLS - 1)) + 1;
  robot.y = (rand() % (((LINES - 1) - 3) + 1)) + 3;
  robot.character = '#';
  robot.color = 0;
  robot.bold = FALSE;
  screen[robot.x][robot.y] = 0;
}

void initialize_kitten()
{
  do
  {
    kitten.x = (rand() % (COLS - 1)) + 1;
    kitten.y = (rand() % (((LINES - 1) - 3) + 1)) + 3;
  }
  while (screen[kitten.x][kitten.y] != (-1));
  do
  {
    kitten.character = (rand() % ((126 - '!') + 1)) + '!';
    ;
  }
  while (!validchar(kitten.character));
  screen[kitten.x][kitten.y] = 1;
  kitten.color = (rand() % 6) + 1;
  kitten.bold = (rand() % 2) ? (TRUE) : (FALSE);
}

void initialize_bogus()
{
  int counter;
  int index;
  for (counter = 0; counter < num_bogus; counter += 1)
  {
    bogus[counter].color = (rand() % 6) + 1;
    bogus[counter].bold = (rand() % 2) ? (TRUE) : (FALSE);
    do
    {
      bogus[counter].character = (rand() % ((126 - '!') + 1)) + '!';
      ;
    }
    while (!validchar(bogus[counter].character));
    do
    {
      bogus[counter].x = (rand() % (COLS - 1)) + 1;
      bogus[counter].y = (rand() % (((LINES - 1) - 3) + 1)) + 3;
    }
    while (screen[bogus[counter].x][bogus[counter].y] != (-1));
    screen[bogus[counter].x][bogus[counter].y] = counter + 2;
    do
    {
      index = rand() % ((sizeof(messages)) / (sizeof(char *)));
    }
    while (used_messages[index] != 0);
    bogus_messages[counter] = index;
    used_messages[index] = 1;
  }

}

void initialize_screen()
{
  int counter;
  mvprintw(0, 0, "robotfindskitten v%s\n\n", ver);
  for (counter = 0; counter <= (COLS - 1); counter += 1)
  {
    printw("%c", 95);
  }

  for (counter = 0; counter < num_bogus; counter += 1)
  {
    draw(bogus[counter]);
  }

  draw(kitten);
  draw(robot);
  refresh();
}

void instructions()
{
  char dummy;
  mvprintw(0, 0, "robotfindskitten v%s\n", ver);
  printw("By the illustrious Leonard Richardson (C) 1997, 2000\n");
  printw("Written originally for the Nerth Pork robotfindskitten contest\n\n");
  printw("In this game, you are robot (");
  draw_in_place(robot);
  printw("). Your job is to find kitten. This task\n");
  printw("is complicated by the existence of various things which are not kitten.\n");
  printw("Robot must touch items to determine if they are kitten or not. The game\n");
  printw("ends when robotfindskitten. Alternatively, you may end the game by hitting\n");
  printw("the Esc key. See the documentation for more information.\n\n");
  printw("Press any key to start.\n");
  refresh();
  dummy = getch();
  clear();
}

void finish(int sig)
{
  endwin();
  printf("%c%c%c", 27, '(', 'B');
  exit(0);
}

void play_game()
{
  int old_x = robot.x;
  int old_y = robot.y;
  int input;
  input = getch();
  while (((input != 27) && (input != 'q')) && (input != 'Q'))
  {
    process_input(input);
    if (!((old_x == robot.x) && (old_y == robot.y)))
    {
      mvaddch(old_y, old_x, ' ');
      screen[old_x][old_y] = -1;
      draw(robot);
      refresh();
      screen[robot.x][robot.y] = 0;
      old_x = robot.x;
      old_y = robot.y;
    }
    input = getch();
  }

  message("Bye!");
  refresh();
  finish(0);
}

void process_input(int input)
{
  int check_x = robot.x;
  int check_y = robot.y;
  switch (input)
  {
    case 'L' - 64:
    {
      wrefresh(curscr);
      break;
    }

    case KEY_UP:

    case 'k':

    case 'K':

    case 'P' - 64:
    {
      check_y -= 1;
      break;
    }

    case KEY_HOME:

    case 'y':

    case 'Y':
    {
      check_x -= 1;
      check_y -= 1;
      break;
    }

    case KEY_PPAGE:

    case 'u':

    case 'U':
    {
      check_x += 1;
      check_y -= 1;
      break;
    }

    case KEY_DOWN:

    case 'j':

    case 'J':

    case 'N' - 64:
    {
      check_y += 1;
      break;
    }

    case KEY_END:

    case 'b':

    case 'B':
    {
      check_x -= 1;
      check_y += 1;
      break;
    }

    case KEY_NPAGE:

    case 'n':

    case 'N':
    {
      check_x += 1;
      check_y += 1;
      break;
    }

    case KEY_LEFT:

    case 'h':

    case 'H':

    case 'B' - 64:
    {
      check_x -= 1;
      break;
    }

    case KEY_RIGHT:

    case 'l':

    case 'L':

    case 'F' - 64:
    {
      check_x += 1;
      break;
    }

    case 0:
    {
      break;
    }

    default:
    {
      message("Invalid input: Use direction keys or Esc.");
      return;
    }

  }

  if ((((check_y < 3) || (check_y > (LINES - 1))) || (check_x < 0)) || (check_x > (COLS - 1)))
  {
    return;
  }
  if (screen[check_x][check_y] != (-1))
  {
    switch (screen[check_x][check_y])
    {
      case 0:
      {
        break;
      }

      case 1:
      {
        move(1, 0);
        clrtoeol();
        play_animation(input);
        break;
      }

      default:
      {
        message(messages[bogus_messages[screen[check_x][check_y] - 2]]);
        break;
      }

    }

    return;
  }
  robot.x = check_x;
  robot.y = check_y;
}

int validchar(char a)
{
  switch (a)
  {
    case '#':

    case ' ':

    case 127:
    {
      return 0;
    }

  }

  return 1;
}

void play_animation(int input)
{
  int counter;
  for (counter = 4; counter > 0; counter -= 1)
  {
    mvaddch(1, (50 + counter) + 1, ' ');
    move(1, 50 + counter);
    if ((((input == KEY_RIGHT) || (input == KEY_DOWN)) || (input == KEY_C3)) || (input == KEY_A3))
    {
      draw_in_place(kitten);
    }
    else
      draw_in_place(robot);
    mvaddch(1, 50 - counter, ' ');
    move(1, (50 - counter) + 1);
    if ((((input == KEY_RIGHT) || (input == KEY_DOWN)) || (input == KEY_C3)) || (input == KEY_A3))
    {
      draw_in_place(robot);
    }
    else
      draw_in_place(kitten);
    refresh();
    sleep(1);
  }

  move(1, 0);
  addstr("You found kitten! Way to go, robot!");
  refresh();
  finish(0);
}

void full_draw(screen_object o, bool in_place)
{
  attr_t old;
  short dummy;
  attr_t new;
  attr_get(&old, &dummy, 0);
  new = COLOR_PAIR(o.color);
  if (o.character == '#')
  {
    new |= A_DIM;
  }
  if (o.character <= '\32')
  {
    new |= A_ALTCHARSET;
  }
  if (o.bold)
  {
    new |= A_BOLD;
  }
  attrset(new);
  if (in_place)
  {
    printw("%c", o.character);
  }
  else
  {
    mvprintw(o.y, o.x, "%c", o.character);
    move(o.y, o.x);
  }
  attrset(old);
}

void message(char *message)
{
  move(1, 0);
  clrtoeol();
  mvprintw(1, 0, "%.*s", COLS, message);
  move(robot.y, robot.x);
  refresh();
}

int main(int argc, char *argv[])
{
  if (argc == 1)
  {
    num_bogus = 20;
  }
  else
  {
    num_bogus = atoi(argv[1]);
    if ((num_bogus < 0) || (num_bogus > ((sizeof(messages)) / (sizeof(char *)))))
    {
      printf("Run-time parameter must be between 0 and %d.\n", (sizeof(messages)) / (sizeof(char *)));
      exit(0);
    }
  }
  srand(time(0));
  printf("%c%c%c", 27, '(', 'U');
  initialize_ncurses();
  initialize_arrays();
  initialize_robot();
  initialize_kitten();
  initialize_bogus();
  instructions();
  initialize_screen();
  play_game();
}
